import './App.css';
import Home from "./Home/Home";
import Canteen from "./Canteen/Canteen";
import {Link} from "@mui/material";
function App() {
  return (
    <>
        <Home path="/home"/>
        <Link to="/canteen"><Canteen/></Link>
    </>
  );
}

export default App;
